import React from "react";
import PersonComponent from "./Person/PersonComponent";

const PersonsShowFun = (props) =>
  props.info.map((person, index) => {
    return (
      <PersonComponent
        info={person}
        click={() => props.clicked(index)}
        key={person.id}
      />
    );
  });

export default Persons;
